script: |
  super -f text -I q7901.spq | sort > q7901.out

inputs:
  - name: q7901.spq
    data: |
      SELECT + col1 + + col1 FROM tab0 (FORMAT parquet) WHERE NOT ( ( col1 ) / - + col2 - + col1 * + ( + 49 ) + - - 33 + col2 - - + col0 * - col1 + 19 / - + col1 * - - 7 > + col1 );
  - name: tab0

outputs:
  - name: q7901.out
    data: |
      162
      2
      42
